import "./App.css"; 
import { AiOutlineSearch } from 'react-icons/ai';
import { IoLocation } from 'react-icons/io5';


function App() {
  return (
    <div className="App">

  <div className="midllediv">

    <div className="tobsite">
      <h4>Jobhunt</h4>
      <button className="button"><h4 style={{color:'white'}}>Login</h4></button>
    </div>
    <div style={{backgroundColor:'ye'}}></div>

 {/* <div style={{display:'flex'}}> */}
{/* left site */}
<div className="leftside">
<div style={{height:"20vh",width:'20vw',marginLeft:'20px'}}>    <h2>Get hired<br></br>By the popular<br></br>teams.</h2>
</div> 
<div style={{width:'25vw',marginLeft:'20px',marginTop:'-20px'}}><h6>Find job according to your interest simply click on search<br></br>And choose category according your skills</h6></div>

<div className="searchdiv">
<div className="searchin">
  <div style={{height:'7vh',width:'9vw',display:'flex',justifyContent:'center',alignItems:'center',backgroundColor:'red'}}>
    <AiOutlineSearch/>
    <h6> Job tittle or keywords</h6>
  </div>
  <div style={{height:'7vh',width:'9vw',display:'flex',justifyContent:'center',alignItems:'center',backgroundColor:'red'}}>
    <IoLocation/>
    <h6>Location</h6>
  </div>
  <button>Search</button>
</div>

</div>


</div>


{/* right side */}
<div className="rightdiv">
</div>

</div>





    </div>
  );
}

export default App;
